import React from 'react'
import './header.css'
import { ReactTyped } from "react-typed";

function Header() {
  return (
    <div>
      <ReactTyped
      strings={[
        "Search for products",
        "Search for categories",
        "Search for brands",
      ]}
      typeSpeed={40}
      backSpeed={50}
      attr="placeholder"
      loop
    >
      <input type="text" />
    </ReactTyped>
    </div>
  )
}

export default Header
